// const { Component } = require("react")

import React, { Component } from "react";
import USERS from './data/users'

class Users extends Component {
  render() {
  return (
    <div>
      <div>
        {

          USERS.map(USER => {
            return (

              <div>{USER.name}</div>

           );

          })
        }

      </div>

    </div>

   ) 
  }
}

export default Users;
